(\sqrt{7}+\sqrt{5})^6 &= \sum_{k=0}^{6}\binom{6}{k}(\sqrt{7})^{6-k}(\sqrt{5})^k \\
&= \sum_{k=0}^{6}\binom{6}{k}7^{\frac{6-k}{2}}5^{\frac{k}{2}} \\
&= 7^3\sum_{k=0}^{6}\binom{6}{k}7^{-\frac{k}{2}}5^{\frac{k}{2}}
\end{align*}
